import React from 'react';
import { FaRegTrashAlt } from 'react-icons/fa';

const Face = ({ handleChange, del, items, newItem, setNewItem, onSubmit }) => {
  return (
    <div>
      <center>
        <p>To Do List</p>
      </center>
     

      {items.length ? (
        <ol>
          {items.map((item) => (
            <li key={item.id}>
              <input
                type="checkbox"
                onChange={() => handleChange(item.id)}
                checked={item.checked}

              />
              <label id='check'>{item.name}</label>
              <FaRegTrashAlt
                role="button"
                onClick={() => del(item.id)}
                tabIndex={0}
              />
            </li>
          ))}
        </ol>
      ) : (
        "Your List is Empty"
      )}
    </div>
  );
};

export default Face;
